import React , { Component } from 'react';
import '../assets/Header.css';

class Header extends Component {
    render() {
        return(
            <div className="header">
                <div className="title_area">
                <h4 className="title">김종인의 블로그</h4>
                </div>
            </div>
        )
    }
}

export default Header;
